import React from 'react';
import { Card,CardBody } from 'reactstrap';
import moment from 'moment';


import './booking-card.css';

const BookingCard = ({booking}) => {

    const {photo,userId,userEmail,tourName,fullName,guestSize,phone,bookAt} = booking;

    return <div className='tour__card'>
    <Card>
        <div className="tour__img">
            <img src={photo} alt='tour-img' />
        </div>

        <CardBody>
            <input type="text" value={userEmail} disabled />
            <input type="text" value={booking.fullName} disabled />
            <input type="text" value={booking.tourName} disabled />
            <input type="number" value={booking.guestSize} disabled />
            <input type="date" value={moment(booking.bookAt).format('YYYY-MM-DD')} disabled />
    

        </CardBody>

    </Card>
    </div>
};

export default BookingCard;
